import css from 'styled-jsx/css';

export default css`.header-content {
  height: 60px;
}
.header-content .logo {
  position: absolute;
  display: inline-block;
  font-size: 0px;
  width: 202px;
  height: 70px;
  /* margin: 18px 0; */
  background: url(/static/images/logo.png) no-repeat center center;
  background-size: 100%;
}
`
